import React from 'react';
import { Routes, Route } from 'react-router-dom';
import SignalsContainer from '../components/SignalsContainer';

// Importações preguiçosas (lazy) para evitar referências circulares
const Dashboard = React.lazy(() => import('../screens/Dashboard'));
const Settings = React.lazy(() => import('../screens/Settings'));
const Support = React.lazy(() => import('../screens/Support'));
const Profile = React.lazy(() => import('../screens/Profile'));
const Login = React.lazy(() => import('../screens/LoginScreen'));

const AppRoutes = ({ signals }) => {
  return (
    <React.Suspense fallback={<div>Carregando...</div>}>
      <Routes>
        <Route path="/login" element={<Login />} />
        <Route path="/" element={<SignalsContainer signals={signals} />} />
        <Route path="/dashboard" element={<Dashboard />} />
        <Route path="/settings" element={<Settings />} />
        <Route path="/support" element={<Support />} />
        <Route path="/profile" element={<Profile />} />
      </Routes>
    </React.Suspense>
  );
};

export default AppRoutes;
